      desc: >-
        Её стройное тело и грациозная поза подчеркиваются бархатным хвостом, который, словно живое проявление её эмоций, иногда изогнут и свивается. 


        На шее заметен странный синяк, форма которого привлекает внимание и вызывает любопытство, а вокруг него видны зажившие шрамики - следы от острых лисьих клыков. На безымянном пальце золотое обручальное кольцо с рубином.


        Она пахнет дилометом и ромашками...


